import React from 'react';

function Genie({fav}) {  
  return <i>Genie for {fav}</i>
}

function App() {
  return (
    <div className="App">
      <h1>React</h1>      
      <Genie fav="Kimchi" />
      <Genie fav="bread" />
    </div>
  );
}

export default App;
